import React from 'react';

const HistoryPage = ({historyRecords}) => {return (
    <div>
      <h1>История запросов</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Даты и время запроса</th>
            <th>Nickname</th>
          </tr>
        </thead>
        <tbody>
          {historyRecords.map((record) => (
            <tr key={record.request_id}>
              <td>{record.request_id}</td>
              <td>{record.request_date}</td>
              <td>{record.nickname}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <br />
      <button onClick={() => window.location.href = '/'}>Вернуться к поиску</button>
    </div>
  );
};

export default HistoryPage;
